import './feature.css';


export const Feature = ({title, text}) => {
    return (
        <div className="warProd__features-container__feature">
            <div className="warProd__features-container__feature-title">
              <div />
                <h1>{title}</h1>
            </div>
            <div className="warProd__features-container_feature-text">
                {text}
            </div >
        </div>
    )
}

export default Feature;
